import React, { Component } from 'react';
import {Card ,Row,Col} from 'react-bootstrap';
import student from '../assets/student.png';
import './CustomNav.css';
import './Profile.css';
export default class Profile extends Component {
    render() {
        return (
            <div>
                <main role="main" className="inner cover">
                    <Card style={{ width: '15rem', height: '10rem' }}>
                        <Row style={{ width: '15rem', height: '10rem' }}>
                            <Col > 
                            <Card.Img className="center" variant="left" src={student} style={{ width: '80%'}}/>
                            </Col>
                            <Col> 
                            <Card.Body>
                            <Card.Title class="lead" style={{color: '',textSize:'18px',textAlign:"center"}}>18</Card.Title>
                                <Card.Title class="lead text-center" style={{ color: '#000' }}>STUDENTS</Card.Title>
                            </Card.Body>
                            </Col>
                        </Row>
                    </Card>
                </main>
            </div>
        )
    }
}
